    "Use your webcam to take a photo of your ID.": "Utilisez votre webcam pour prendre une photo de votre pi\u00e8ce d'identit\u00e9.",
    "Use your webcam to take a photo of your ID. We will match this photo with the photo of your face and the name on your account.": "\u4f7f\u7528\u60a8\u7684\u8996\u8a0a\u88dd\u7f6e\u62cd\u651d\u4e00\u5f35\u60a8\u7684\u7167\u7247\u3002\u6211\u5011\u5c07\u6703\u6bd4\u5c0d\u6b64\u5f35\u7167\u7247\u8207\u60a8\u7684ID\u4e0a\u7684\u7167\u7247\u3002",
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u4f7f\u7528\u60a8\u7684\u8996\u8a0a\u88dd\u7f6e\u62cd\u651d\u4e00\u5f35\u60a8\u7684\u7167\u7247\u3002\u6211\u5011\u5c07\u6703\u6bd4\u5c0d\u6b64\u5f35\u7167\u7247\u8207\u60a8\u7684ID\u4e0a\u7684\u7167\u7247\u3002",
