    "You need a driver's license, passport, or other government-issued ID that has your name and photo.": "\u60a8\u9700\u8981\u4e00\u5f35\u99d5\u7167\u3001\u8b77\u7167\uff0c\u6216\u5176\u4ed6\u653f\u5e9c\u7c3d\u767c\u7684\u8b49\u4ef6\uff0c\u9700\u5305\u542b\u60a8\u7684\u59d3\u540d\u548c\u7167\u7247\u3002",
    "You need a valid ID that contains your full name and photo.": "Vous avez besoin d'une pi\u00e8ce d'identit\u00e9 valide comportant votre nom complet et une photo.",
    "You need an ID with your name and photo. A driver's license, passport, or ID are all acceptable.": "Vous avez besoin d'une pi\u00e8ce d'identit\u00e9 avec votre nom et une photo. Un permis de conduire, un passeport ou une pi\u00e8ce d'identit\u00e9 sont accept\u00e9s.",
    "You need an ID with your name and photo. A driver's license, passport, or other government-issued IDs are all acceptable.": "\u60a8\u9700\u8981\u4e00\u500b\u6709\u60a8\u7684\u540d\u5b57\u4ee5\u53ca\u7167\u7247\u7684ID\u3002\u4e00\u5f35\u99d5\u7167\u3001\u8b77\u7167\uff0c\u6216\u5176\u4ed6\u653f\u5e9c\u7c3d\u767c\u7684\u8b49\u4ef6\u90fd\u53ef\u63a5\u53d7\u3002",
    "You need to activate your account before you can enroll in courses. Check your inbox for an activation email.": "\u5728\u8a3b\u518a\u8ab2\u7a0b\u524d\uff0c\u60a8\u9700\u8981\u555f\u52d5\u60a8\u7684\u8cec\u865f\u3002\u6aa2\u67e5\u60a8\u4fe1\u7bb1\u4e2d\u7684\u555f\u52d5\u90f5\u4ef6\u3002",
    "You need to activate your account before you can enroll in courses. Check your inbox for an activation email. After you complete activation you can return and refresh this page.": "\u5728\u8a3b\u518a\u8ab2\u7a0b\u524d\uff0c\u60a8\u9700\u8981\u555f\u52d5\u60a8\u7684\u8cec\u6236\u3002\n\u6aa2\u67e5\u60a8\u4fe1\u7bb1\u4e2d\u7684\u555f\u52d5\u90f5\u4ef6\u3002\u5b8c\u6210\u555f\u52d5\u5f8c\uff0c\u60a8\u53ef\u518d\u56de\u4f86\u4ee5\u53ca\u5237\u65b0\u6b64\u9801\u9762\u3002",
